import requests
import json

url = "https://businesscardanalyser.saturnai.in/run_jindal_receipt_reader"

payload = json.dumps({
  "phone_number": "1234567890",
  "primary_image": "",
})
headers = {
  'Content-Type': 'application/json'
}

response = requests.request("POST", url, headers=headers, data=payload)

print(response.text)
